  return (
    <Tabs defaultActiveKey="home" transition={false} id="noanim-tab-example">
      <Tab eventKey="home" title="친구 목록">
        <div>hi</div>
      </Tab>
      <Tab eventKey="profile" title="친구 요청 목록">
        <div>hi</div>
      </Tab>
      <Tab eventKey="contact" title="Contact" disabled>
        <div>hi</div>
      </Tab>
    </Tabs>
  );
}

export default Friend;
